const imageURLs = [{
    id: 1,
    url: "data:image/png;base64,",
}];
export const loadImages = async (): Promise<{ id: number, image: HTMLImageElement }[]> => {
    const loadedImages: { id: number, image: HTMLImageElement }[] = [];

    for (const item of imageURLs) {
        await new Promise((resolve) => {
            const tmp = new Image();
            tmp.onload = () => {
                loadedImages.push({ id: item.id, image: tmp });
                resolve(true);
            };
            tmp.src = item.url;
        });
    }

    return loadedImages;
};
export var images: { id: number, image: HTMLImageElement }[];
const loadImgs = async () => {
    try {
        images = await loadImages();
    } catch (err) {
        console.log(err);
    }
}
